import React from 'react';
import '../assets/css/site.css';
import '../assets/css/v2.css';
import '../assets/css/bootstrap/bootstrap-extend.min.css';
import '../assets/fonts/web-icons/web-icons.min.css';
import '../assets/fonts/font-awesome/font-awesome.css';
import '../assets/fonts/brand-icons/brand-icons.min.css';
import AppNavbar from './AppNavbar';
import AppSidebar from './AppSidebar';

class App extends React.Component {
  render(){
    return (
      <div id="wrapper">
        <AppSidebar/>
        <AppNavbar/>
        <div className="page">
          <div className="page-header h-200">
            <div className="text-center blue-grey-800 mt-30 m-xs-0">
              <div className="font-size-50 blue-grey-800"><b>Ol√°</b> Diego Massari </div>
            </div>
          </div>
          <div className="page-content container-fluid">
            <div className="row">
              <div className="col-xl-4 col-lg-4 col-md-12 col-sm-12" style={{height:"236"}}>
                <div className="panel panel-line">
                  <div className="panel-heading">
                    <h3 className="panel-title">Nossas Redes Sociais</h3>
                  </div>
                  <div className="panel-body">
                    <p>
                      Siga-nos e fique por dentro das novidades e tenha acesso a muitas dicas de como usar suas redes sociais para conseguir novos clientes todos os dias!
                    </p>
                    <a className="btn btn-tagged social-facebook" target="_blank" href="http://fb.me/gerarmeoficial">
                      <span className="btn-tag btn-sm"><i class="icon bd-facebook" style={{marginTop: "-15px"}} aria-hidden="true"></i></span>Facebook
                    </a>
                    <a className="btn btn-tagged social-instagram" target="_blank" href="http://instagram.com/gerar.me">
                      <span className="btn-tag btn-sm"><i class="icon bd-instagram" style={{marginTop: "-15px"}} aria-hidden="true"></i></span>Instagram
                    </a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
